import React, { useEffect, useState } from "react";
import { Component } from 'react';
import { BrowserRouter,Route, Routes } from "react-router-dom";
import HowAlpha from "./HowAlpha";
import HowRoseta from ".HowRoseta";
import Prediction from "./pages/Prediction";
import Pred_mech from "./pages/Pred_mech";
import Pred_skills from "./pages/Pred_skills";
import Pred_ability from "./pages/Pred_ability";



export default function Refer() {
  return (
    <BrowserRouter>
    <div >
       {/* prediction 안에 메뉴 */}
       <nav className="prediction_nav">
           <li>
            <a href="/Refer/Prediction/*" className="pred_1">
                1. 단백질 구조 예측 AI의 의의
            </a>
          </li>

          <li>
            <a href="/Refer/Prediction/*" className="pred_2">
                2. 단백질 구조 예측 AI 메커니즘
            </a>
          </li>

          <li>
            <a href="/Refer/Prediction/*" className="pred_3">
                3. 주요 기술
            </a>
          </li>

          <li>
            <a href="/Refer/Prediction/*" className="pred_4">
                4. 성능확인
            </a>
          </li>

        </nav>
      <Routes>


        <Route path="/Refer/Prediction/*" element ={ <Prediction/>} />
        <Route path="/Refer/Prediction/mechanism*" element ={ <Pred_mech/>} />
        <Route path="/Refer/Prediction/ability*" element ={ <Pred_ability/>} />
        <Route path="/Refer/Prediction/skills*" element ={ <Pred_skills/>} />



      </Routes>
    </div>
  </BrowserRouter>
  );
}
